import React from 'react';

const WeatherExtraInfo = ({humidity, wind}) =>(
	<div>
		<span>{`${humidity} %`  }</span>
		<div>
			<span>{`${wind} wind` }</span>
		</div>
		
	</div>
);

export default WeatherExtraInfo;
